import{o as r,c as p,a as s}from"./index-bc534cc9.js";const e={class:"markdown-body"},d="2025-06-19T00:00:00.000Z",m="2025-06-19T00:00:00.000Z",i="想法",g="实习随笔",u={__name:"实习随笔",setup(n,{expose:o}){return o({frontmatter:{date:"2025-06-19T00:00:00.000Z",updated:"2025-06-19T00:00:00.000Z",category:"想法",summary:"实习随笔"}}),(l,t)=>(r(),p("div",e,t[0]||(t[0]=[s("<h2>1</h2><hr><p>第一周： 感觉很多都是在干打杂，虽然也没有期望什么，更多的是体验吧，还拿到实习证明，就OK了。</p><p>实习内容累倒是不累，但是每天通勤啊，实习第一个月没多少钱啊，一个人租房没人一起玩啊……累、不舒畅的感觉倒是来源于这些方向。</p><p>对<strong>还有作业、论文、报告没写完</strong>， 这就太痛苦了。</p><p>学习到的东西呢：</p><ul><li>公司里的分工、交流都太细、太完善了，好难看清全局</li><li>mentor 一直 是有dll 库， 有开源包可以用吗</li><li>“你先写好一个小 demo 展示”</li><li>还行，现阶段还比较简单，对我来说能实现</li></ul><p>具体的点（详细只是记录文档写在其他文章了）</p><hr><p><strong>WPF 架构</strong></p><p><strong>dll 动态链接库的调用</strong></p><p><strong>adb</strong></p><hr><h2>2</h2><p>上周五下班后，心情很好，回家时顺道饶了点路去大润发买零食，绕的话骑自行车就要逆行大概800米左右(不逆行差不多变成3公里)，往家赶的时候下了小雨，雨点，我东西放在了自行车框里，担心掉出来就蹬得不是很快，但是遇到了前面行走阿姨，带两个小女孩，完全挡住了路，我按了一下铃，小女孩让路了，然后阿姨就来了一句，“你让了干什么，这本来就是人行道”。</p><p>我不知道说什么，但是就是记得很深。当然我也不认为我做的对，更不认为我做得错。</p>",16)])))}};export{i as category,d as date,u as default,g as summary,m as updated};
